@TratsiakY Agreed. As an outside contributor, I created the [same issue](https://github.com/microsoft/onnxruntime/issues/3879) a while back. After some head-banging, I ended up adding a couple [C++ examples](https://github.com/microsoft/onnxruntime/tree/master/samples/c_cxx/model-explorer) myself to the repo that I thought were much easier to follow than the other examples.

In the master branch, I've updated several aspects of the C++ API since the last release (including the addition of a new Experimental API that allows for more modern C++ code) that should make life easier (see the model-explorer example). You will need to download and build from source in order to take advantage of the latest additions.

There is still a lot of room for improvement on the C++ documentation front. My best suggestion is review the python documentation [here](https://microsoft.github.io/onnxruntime/python/api_summary.html) to understand the nomenclature of the API and then read the header file directly. Most of the public-facing API calls are not documented at this point however the function names resemble the python docs close enough that it's reasonable to refer to the python docs for guidance.
